import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay, EffectCube, Navigation } from "swiper";

import "swiper/css";
import "swiper/css/effect-cube";
import "swiper/css/navigation";

export default function Carousel() {
  return (
    <Swiper
      effect={"cube"}
      rewind={true}
      navigation={true}
      grabCursor={true}
      autoplay={{
        delay: 5000,
        disableOnInteraction: false,
      }}
      cubeEffect={{
        shadow: false,
        slideShadows: true,
        shadowOffset: 20,
        shadowScale: 0.94,
      }}
      pagination={false}
      modules={[EffectCube, Autoplay, Navigation]}
      className="mySwiper"
    >
      <SwiperSlide>Teacher</SwiperSlide>
      <SwiperSlide>Software Engineer</SwiperSlide>
    </Swiper>
  );
}
